import React from "react";

const Pistols = (props) => {
  const testTest = () => {
    console.log("documents[1]: ", props.fullData.documents[1].fields.name);
  };

  return (
    <div className="pistol-Card">
      <h1> Hello World</h1>
      {props.fullData ? (
        <h1>{props.fullData.documents.fields}</h1>
      ) : (
        "Loading.."
      )}
    </div>
  );
};

export default Pistols;
